import Link from 'next/link';
const Navbar = () => (
    <div className="menu">
            <ul>
                <li><Link href='/'><a>Home</a></Link></li>
                <li><Link href='/about'><a>About</a></Link></li>
                <li><Link href='/articles'><a>Articles</a></Link></li>
                <li><Link href='/projects'><a>Projects</a></Link></li>
            </ul>

    </div>
);

export default Navbar;
